  \"Rapid Assessment for basal cavities on Dahomey National Wildlife Refuge: Implications
  for Present and Future Bat Conservation\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:28.958780\",\n\t\"name\": \"rapid-assessment-for-basal-cavities-on-dahomey-national-wildlife-refuge-implications-for-p\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Survey of mature forested areas on the
  refuge was done to examine trees with basal cavities for bats.  Though the refuge
  supports many large diameter trees with basal cavities of sufficient interior demensions
  to support diurnal roosting bats, none were detected.  The refuge appears suitable
  for Rafinesque's big-eared bat and southeastern myotis in comparison to other areas
  in MS were these species have been found.  However, the refuge appears to be a disjunt
  forested island in the surrounding private agricultural landscape.\",\n\t\"license_title\":
